import React from "react";

import "./Ingame.css"
import MessageBox from './MessageBox/MessageBox'
import Messages from './Messages/Messages'
import PlayerList from './PlayerList/PlayerList'
import useGame from './_useGame'



const Chat = () => {
    const {messages, sendMessage, players} = useGame();
    console.log(players)
    return (
        <div class="row">
        <div class="column left border-right border-left">
            Players:

        </div>
        <div class="column middle border-right">
            <div class="row" id='messageContainer'>
            <Messages messages = {messages} />
            </div>
            <div class="row">
            <MessageBox onSendMessage={ message => {
                sendMessage({message});
            }}/>
            </div>
        </div>
        <div class="column right border-right">
            <PlayerList playerList={players} />
        </div>
        </div>
    );
}

export default Chat;
